function daysSince(givenDate: Date) {
    const currentDate = new Date();

    // Calculate the difference in milliseconds
    const differenceInMilliseconds = currentDate.getTime() - givenDate.getTime();

    // Convert milliseconds to days
    const millisecondsInDay = 1000 * 60 * 60 * 24;
    const days = Math.floor(differenceInMilliseconds / millisecondsInDay);

    return days;
};
function addEntryToLedger(description: string, amount: number) {
    const lastEntry = database.value.ledger[database.value.ledger.length - 1]!;
    let entry = { description, amount } as LedgerEntry;
    entry.runningProfit = lastEntry.runningProfit + entry.amount;
    entry.id = lastEntry.id + 1;
    entry.timestamp = daysSince(new Date(2024, 0, 1));
    database.value.ledger.push(entry);
};

